package operator;
import java.util.Scanner;

public class swap {

	public static void main(String[] args) {
		Scanner s=new Scanner(System.in);
		int a=s.nextInt();
		int b=s.nextInt();
		int c=s.nextInt();
		a=c;
		b=a;
		c=b;
		System.out.println("a ="+a);
		System.out.println("b ="+b);
		// TODO Auto-generated method stub

	}

}
